function DepCkbxControl(chkBox, txtFld)
{
	if (eeSelection == 1)
	{
		DepAnswerOpen();
	}
	else
	{		
		DepAnswerClose();
	}	
}			

// Sets all _Answer fields that have a checked box to open.
function DepAnswerOpen()
{
	if (eeSelection == "1")
	{
		var b = xfa.resolveNode("spSelection" + item.name.substr(10,99) + "_Answer");
		b.access = "open";
		b.validate.nullTest = "error";
	}
	else
	{
		var b = xfa.resolveNode(spSelection + item.name.substr(10,99) + "_Answer");
		b.access = "protected";
		b.rawValue = "";
		b.validate.nullTest = "";
	}					
}

